import React from 'react';
import '../../assets/styles/global.css';
import './style-menu.css';
import Icon from '../../assets/images/icon.png';

export default function Menu() {
    return (
        <div className="container-menu">
            <ul>
                <img src={Icon} alt="free logo"/>
            </ul>
            <ul>
                <li>Home</li>
                <li>Sobre</li>
            </ul>
        </div>
    );
}
